Count 2 - Bail Jumping - No contest plea.   Convicted.   State moves to dismiss and read in counts 3 - 5, 3 cts. bail jumping.   Motion granted.    Sentences are withheld.   Defendant is placed on probation to DOC for eighteen (18) months.   Conditions of probation are:
1) Fifteen (15) days jail, imposed and stayed, to be imposed upon the agent's discretion; 
2) Assesment/treatment/counseling as deemed appropriate by the Department's assessment process;
3) AODA assessment and follow through;
4) Maintain absolute sobriety; 
5) Maintain full-time employment/job search combination; 
6) Pay costs of action; 
7) Pay supervision fees in an amount to be determined by DOC;
8) Submit DNA sample.  
$150.00 cash bail applied to costs.  
